import React from 'react'


export default function Head() {
  return (
    <div>
    <div className='head'>
      <div style={{minHeight: '110px'}}>         
        <button className='text' >Программа интерактивного обучения поведению с агрессивными животными</button>
        </div>  
    </div>
    </div>
  )
}
